  selector: 'app-input-test',
  templateUrl: './input-test.component.html',
  styleUrls: ['./input-test.component.css'],
})
export class InputTestComponent {
  inputTestInfo = 'This is an Input Test';
}
<div class="container">
  <div class="row">
    <div class="col-3">
      <label>{{ inputTestInfo }}</label>
    </div>
    <div class="col-3">
      <!-- <input type="text" class="form" (input)="onTestInput($event)" /> -->
    </div>
  </div>
</div>

<button class="btn btn-primary"></button>
